import React from 'react';
import './App.css';
import axios from 'axios'


AppendData(response)
  {


    let albums = response[0].albums.split(',');
    let artists = response[0].artists.split(',');
    let songs = response[0].songs.split(',');

    let albumsElement = document.getElementById('albums');
    let artistsElement = document.getElementById('artists');
    let songsElement = document.getElementById('songs');

    albums.forEach(album => {
        albumsElement.appendChild("<li>" + album + "</li>")        
    });


    artists.forEach(artist => {
      artistsElement.appendChild("<li>" + artist + "</li>")        
    });

    songs.forEach(song => {
      songsElement.appendChild("<li>" + song + "</li>")        
    });

  }


class App extends React.Component {

  componentDidMount() {
    this.getData()
  }
  async getData(){
    const response =
      await axios.get("http://localhost:8000/api/music")

      appendData(response);
  };





  render(){
    return (
      <div className="App">
        <header className="App-header">
          <div id="albums">
            Albums
              <ul>

              </ul>
          </div>
          <div id="artists">
            Artists
              <ul>

              </ul>
          </div>
          <div id="songs">
            Songs
              <ul>

              </ul>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
